export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},fw6WR7OOtr:{data:{id:1437,attributes:{imdbId:"tt0464049",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTQ3NTMxMzY5MF5BMl5BanBnXkFtZTcwMzY4OTQ0MQ@@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.8\u002F10"},{Source:"Rotten Tomatoes",Value:"66%"},{Source:"Metacritic",Value:"74\u002F100"}],item_lang:{data:{id:2100,attributes:{title:h,plot:"In 1980s Britain, a group of young men at Cutlers' Grammar School all have the brains, and the will to earn the chance of getting accepted in the finest universities in the nation, Oxford and Cambridge. Despite the fine teaching by excellent professionals like Mrs. Dorothy Lintott (Frances de la Tour) in history and the intellectually enthusiastic Mr. Hector (Richard Griffiths) in General Studies, the Headmaster (Clive Merrison) is not satisfied. He signs on the young Irwin (Stephen Campbell Moore) to polish the students' style to give them the best chance. In this mix of intellectualism and creative spirit that guides a rigorous preparation regime for that ultimate educational brass ring, the lives of the randy students and the ostensibly restrained faculty intertwine that would change their lives forever.",slug:"the-history-boys"}}},books:{data:[{id:7656,attributes:{title:i,description:j,thumbnail:k,authors:[b],firstBook:true,published:l,publisher:f,subtitle:d}},{id:7657,attributes:{title:h,description:"An unruly bunch of bright, funny sixth-form boys in pursuit of sex, sport and a place at university. A maverick English teacher at odds with the young and shrewd supply teacher. A headmaster obsessed with results; a history teacher who thinks he's a fool. In Alan Bennett's screenplay, staff room rivalry and the anarchy of adolescence provoke insistent questions about history and how you teach it; about education and its purpose. Fox Searchlight Pictures, DNA and the BBC have joined forces to bring the National Theatre's award-winning production of The History Boys to the big screen, directed by Nicholas Hytner from a script adapted for the screen by Alan Bennett.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=2Wp3nwq-B_AC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,"Nicholas Hytner"],firstBook:e,published:"2006-01-01",publisher:d,subtitle:"The Film"}},{id:7658,attributes:{title:i,description:j,thumbnail:k,authors:[b],firstBook:e,published:l,publisher:f,subtitle:d}},{id:7659,attributes:{title:"The History Boys: The Film",description:"Now a major motion picture from Fox Searchlight Pictures, The History Boys: The Film contains Alan Bennett's diary of the filming, the shooting script, and an introduction by director Nicholas Hytner, as well as an extensive plate section that includes a look behind the scenes and stills from the film. An unruly bunch of bright, funny sixth-form (or senior) boys in a British boys' school are, as such boys will be, in pursuit of sex, sport, and a place at a good university, generally in that order. In all their efforts, they are helped and hindered, enlightened and bemused, by a maverick English teacher who seeks to broaden their horizons in sometimes undefined ways, and a young history teacher who questions the methods, as well as the aim, of their schooling. In The History Boys, Alan Bennett evokes the special period and place that the sixth form represents in an English boy's life. In doing so, he raises not only universal questions about the nature of history and how it is taught but also questions about the purpose of education today.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=o7O_YyMt7-cC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2006-11-14",publisher:f,subtitle:d}},{id:7660,attributes:{title:"Alan Bennett Plays 2",description:"This second volume of plays by Alan Bennett includes his two Kafka plays, one an hilarious comedy, the other a profound and searching drama. Also included is An Englishman Abroad and A Question of Attribution. The fascination of these two plays lies in the way they question our accepted notions of treachery and, in different ways, make a sympathetic case for Guy Burgess and Anthony Blunt.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gRx3mgYmU9EC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2009-02-19",publisher:"Faber & Faber",subtitle:"Kafka's Dick; Insurance Man; Old Country; Englishman Abroad; Question of Attribution"}}]}}},meta:{}}},prerenderedAt:1694069568114}}("movie","Alan Bennett","series","",null,"Farrar, Straus and Giroux",1,"The History Boys","The History Boys: A Play","\"A play of depth as well as dazzle, intensely moving as well as thought-provoking and funny.\" —The Daily Telegraph An unruly bunch of bright, funny sixth-form (or senior) boys in a British boys' school are, as such boys will be, in pursuit of sex, sport, and a place at a good university, generally in that order. In all their efforts, they are helped and hindered, enlightened and bemused, by a maverick English teacher who seeks to broaden their horizons in sometimes undefined ways, and a young history teacher who questions the methods, as well as the aim, of their schooling. In The History Boys, Alan Bennett evokes the special period and place that the sixth form represents in an English boy's life. In doing so, he raises—with gentle wit and pitch-perfect command of character—not only universal questions about the nature of history and how it is taught but also questions about the purpose of education today.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=fffReGCIKPwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2006-04-04"))